import React from "react";

function Projects() {
  return (
    <section>
      <h2>Projects</h2>
      <ul>
        <li><strong>A Queue application:</strong> Create to avoid standing in the long lines</li>
        <li><strong>Hello HERO:</strong> An app designed to treat school children remotely for the therapist & there clients</li>
        <li><strong>eZRx:</strong> An web app designed for a south east asian pharmaceutical company to sell there products to the vendors online</li>
        <li><strong>Banking application:</strong> Designed for an ireland bank</li>
      </ul>
    </section>
  );
}

export default Projects;
